import React, { useState } from 'react';

import { Link } from 'react-router-dom';

import './styles.css';

const WorkStationItem = ({ workstation }) => {
  const [workStationId, setWorkStationId] = useState(workstation.id);

  async function sendId() {
    const response = await api
      .get(`workstation/${workstationId}`, {
        headers: {
          authorization: authorization_user,
        },
      })
      .then((response) => {
        setWorkStation(response.data.workstation);
        setSchedules(response.data.schedules);
        setRooms(response.data.rooms);
      });
  }

  return (
    <article className="workstation-item">
      <header>
        <div>
          <strong>{workstation.name}</strong>
        </div>
      </header>
      <p>{workstation.description}</p>

      <footer>
        <button onClick={sendId}>Agendar WorkStation</button>
      </footer>
    </article>
  );
};

export default WorkStationItem;
